import style from './Header.module.css';
const Header = () => {
    return (
        <header>
            <h1 className={style['logo']}>Hschool</h1>
            <div className={style['header-butt']}></div>

            <p className={style['name-p']}>Header</p>
        </header>
    );
}

export default Header;
